import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Link } from 'react-router-dom';
import logo from "../images/logo-black.png"
import "./style.css"
import profImg from '../images/icons8-user-100.png'
import { useSelector,useDispatch } from 'react-redux';
import Cookies from 'js-cookie';
import { deleteUser } from '../redux/userSlice';



function Navbares() {
    const dispatch = useDispatch()
    const yourInlineStyles = {
        display: 'flex',
        textDecoration: 'none',
        alignItems: 'center',
        color: 'black'
    };
    const yourInlineStyle = {
        display: 'flex',
        textDecoration: 'none',
        alignItems: 'center',
        color: 'white'
    };
    const userData = useSelector((state) => state?.users ?? 'Not available');
    const isAuth = userData && userData.isAuth;
    const userName = userData?.user?.userDetails?.userName;

    const logOut = () => {
        Cookies.remove("token")
        dispatch(deleteUser(''))
    }
    return (
        <div className='nav-main'>
            <Navbar expand="lg" className="bg-white " data-bs-theme="black">
                <Container>
                    <Navbar.Brand href="#home">
                        <img className='nav-logo' src={logo} alt="" />

                    </Navbar.Brand>
                    <div className='prof-menuIcon' style={{ display: 'flex', alignItems: "center" }}>

                        <Navbar.Toggle aria-controls="basic-navbar-nav" style={{ height: '50px' }} />
                    </div>


                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="me-auto">
                            <Link to={'/'} style={yourInlineStyles}><b>Home</b></Link>

                            <Nav.Link ><b>Menu</b></Nav.Link>
                            <Nav.Link><b>Gallery</b></Nav.Link>
                            <Link style={yourInlineStyles}><b>Contact</b></Link>
                            {isAuth && <Link className='Link' to={'/dashboard'}><b>Dashboard</b></Link>}

                        </Nav>

                        <div className='nav-end-section'>
                            <div>

                                {isAuth ?

                                    <div className='nav-logout'>
                                        <Link className='btn btn-dark ' onClick={logOut} style={yourInlineStyle}>Logout</Link>
                                        <div className='nav-profsection'>
                                            <img src={profImg} className='profimg' alt="Profile" />
                                            <span  className='profilName'><b>{userName}</b></span>
                                        </div>


                                    </div>

                                    :

                                    <Link className='btn btn-dark nav-btn' to={'/login'} style={yourInlineStyle}>Login</Link>

                                }
                            </div>

                        </div>

                    </Navbar.Collapse>

                </Container>
            </Navbar>
        </div>
    )
}

export default Navbares
